@test integrate((a+b*arcsin(c*x))^-3//2, x) == :(-2*b^-1*c^-1*(1+-1*c^2*x^2)^(1/2)*(a+b*arcsin(c*x))^-1//2+-2*2^(1/2)*pi^(1/2)*b^-3//2*c^-1*cos(a*b^-1)*fresnels(2^(1/2)*pi^-1//2*b^-1//2*(a+b*arcsin(c*x))^(1/2))+2*2^(1/2)*pi^(1/2)*b^-3//2*c^-1*fresnelc(2^(1/2)*pi^-1//2*b^-1//2*(a+b*arcsin(c*x))^(1/2))*sin(a*b^-1))
